name = "botocore-stubs"
version = "1.23.37"
description = "Type annotations for botocore 1.23.37, generated by mypy-boto3-builder 6.3.2"
category = "main"
optional = false
python-versions = ">=3.6"

[package.dependencies]
typing-extensions = {version = "*", markers = "python_version < \"3.9\""}

